eval("module.exports = /*#__PURE__*/JSON.parse('{\"communityMessagedata\":[{\"author\":{\"user\":\"Alice\",\"id\":\"admin\"},\"text\":\"Hey Michale, Charlie! Seen the latest posts in the Design Community? Amazing projects!\",\"timeStamp\":\"October 25, 2024 07:30\"},{\"author\":{\"user\":\"Michale Suyama\",\"id\":\"user1\",\"avatarBgColor\":\"#87cefa\"},\"text\":\"Hi Alice! Yes, Dana’s new UI design is incredible.\",\"timeStamp\":\"October 25, 2024 08:00\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\",\"avatarBgColor\":\"#e6cdde\"},\"text\":\"Hey! I loved Dana’s use of color. Frank’s typography guide was great too.\",\"timeStamp\":\"October 25, 2024 11:00\"},{\"author\":{\"user\":\"Alice\",\"id\":\"admin\"},\"text\":\"Absolutely! Any new community events planned?\",\"timeStamp\":\"October 26, 2024 11:00\"},{\"author\":{\"user\":\"Michale Suyama\",\"id\":\"user1\",\"avatarBgColor\":\"#87cefa\"},\"text\":\"We should organize a design challenge.\",\"timeStamp\":\"October 26, 2024 12:15\"},{\"author\":{\"user\":\"Janet\",\"id\":\"user3\",\"avatarBgColor\":\"#dec287\",\"avatarUrl\":\"./src/chat-ui/images/janet.png\"},\"text\":\"I am excited to see the new projects.\",\"timeStamp\":\"October 26, 2024 12:17\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\",\"avatarBgColor\":\"#e6cdde\"},\"text\":\"Great idea! Let’s discuss it in the next meeting.\",\"timeStamp\":\"October 26, 2024 12:30\"},{\"author\":{\"user\":\"Alice\",\"id\":\"admin\"},\"text\":\"Sounds good! This community is so inspiring.\"},{\"author\":{\"user\":\"Michale Suyama\",\"id\":\"user1\",\"avatarBgColor\":\"#87cefa\"},\"text\":\"Agreed! Excited to see everyone’s ideas.\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\",\"avatarBgColor\":\"#e6cdde\"},\"text\":\"I am looking forward to the design challenge.\"}],\"chatMessagedata\":[{\"author\":{\"user\":\"Albert\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/andrew.png\"},\"text\":\"Hi there! How\\'s it going?\"},{\"author\":{\"user\":\"Reena\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/reena.png\"},\"text\":\"Hey! I\\'m doing well, thanks. How about you?\"},{\"author\":{\"user\":\"Albert\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/andrew.png\"},\"text\":\"Mostly the usual stuff. I did start a new hobby - painting!\"}],\"integrationMessagedata\":[{\"author\":{\"user\":\"Reena\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/reena.png\"},\"text\":\"Hey, I\\'m having trouble with my computer. It keeps freezing.\"},{\"author\":{\"user\":\"Albert\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/andrew.png\"},\"text\":\"Oh, that\\'s annoying. Have you tried restarting it?\"},{\"author\":{\"user\":\"Reena\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/reena.png\"},\"text\":\"Yeah, I did, but it didn\\'t help.\"},{\"author\":{\"user\":\"Albert\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/andrew.png\"},\"text\":\"Sometimes, outdated software or malware can cause issues.\"},{\"author\":{\"user\":\"Reena\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/reena.png\"},\"text\":\"Okay, I\\'ll try that. Thanks for the help!\"}],\"botMessagedata\":[{\"author\":{\"user\":\"Bot\",\"id\":\"bot\",\"avatarUrl\":\"./src/chat-ui/images/bot.png\"},\"text\":\"Hello Sam, I am a virtual assitant.\"},{\"author\":{\"user\":\"Bot\",\"id\":\"bot\",\"avatarUrl\":\"./src/chat-ui/images/bot.png\"},\"text\":\"Which room are you looking to decorate?\"}],\"botData\":[{\"text\":\"Bedroom\",\"reply\":\"For a bedroom, we can create a serene and calm atmosphere with neutral colors and comfortable bedding.\",\"suggestions\":[\"Garden\",\"Balcony\"]},{\"text\":\"Kitchen\",\"reply\":\"For a kitchen, we can go for a modern, sleek look with stainless steel appliances and minimalist cabinetry. </br> <p>Any other home decor suggestions you\\'d like to explore ?</p>\",\"suggestions\":[\"Wall art\",\"Plants\"]}],\"chatSuggestions\":[\"Bedroom\",\"Kitchen\"],\"walterMessagedata\":[{\"author\":{\"user\":\"Sam\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"Hey Charlie, have you thought about where you want to go for our vacation?\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user5\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\"},\"text\":\"Hi Sam! I was thinking about going to Bali. I\\'ve heard the beaches are beautiful and there\\'s so much to do.\"},{\"author\":{\"user\":\"Sam\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"Bali sounds amazing! I\\'ve always wanted to try surfing. Do you know any good places to stay?\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user5\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\"},\"text\":\"Yes, I found a few nice resorts and some budget-friendly options too. I\\'ll send you the links.\"},{\"author\":{\"user\":\"Sam\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"Great! Let\\'s finalize our plans this weekend.\"}],\"lauraMessagedata\":[{\"author\":{\"user\":\"Laura Callahan\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"Hey Sam, can we have a quick meeting tomorrow morning to discuss the new project?\"},{\"author\":{\"user\":\"Sam\",\"id\":\"user3\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"Sure, what time works best for you?\"},{\"author\":{\"user\":\"Laura Callahan\",\"id\":\"user1\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"10 AM?\"},{\"author\":{\"user\":\"Sam\",\"id\":\"user3\",\"avatarUrl\":\"./src/chat-ui/images/laura.png\"},\"text\":\"10 AM works for me.\"}],\"teamsMessagedate\":[{\"author\":{\"user\":\"Admin\",\"id\":\"team\"},\"text\":\"Hi, everyone!, welcome to the new web team\"},{\"author\":{\"user\":\"Janet\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/janet.png\"},\"text\":\"Hi Sir, excited about the new team.\"},{\"author\":{\"user\":\"Margaret Peacock\",\"id\":\"user3\"},\"text\":\"Good morning ! suprised with the new team message.\"},{\"author\":{\"user\":\"Charlie\",\"id\":\"user2\",\"avatarUrl\":\"./src/chat-ui/images/charlie.png\"},\"text\":\"Hi all, what\\'s the purpose of this new team formation ?\"},{\"author\":{\"user\":\"Admin\",\"id\":\"team\"},\"text\":\"Charlie, we are planning for a new portal launch hence, grouping all in one place.\"}],\"suyamaMessagedata\":[{\"author\":{\"id\":\"user4\",\"user\":\"Reena\"},\"text\":\"Hi, are you available ?\"}],\"templateMessagedata\":[{\"text\":\"Hello! I\\'m the Order tracking bot. how can I help you today?\",\"suggestions\":[\"Track an order\",\"Cancel an order\"]},{\"text\":\"Track an order\",\"reply\":\"Please select the order you want to track\",\"suggestions\":[\"Order #67890\",\"Order #53461\"]},{\"text\":\"Order #67890\",\"reply\":\"Fetching details for order <b>#67890</b> </br></br> Your order is currently being processed and will ship in 2-3 days.\",\"suggestions\":[\"Back to main menu\",\"Need help with something else\"]},{\"text\":\"Order #53461\",\"reply\":\"Fetching details for order <b>#53461</b> </br></br> Your order is currently being processed and will ship in 2-3 days.\",\"suggestions\":[\"Back to main menu\",\"Need help with something else\"]},{\"text\":\"Order #87890\",\"reply\":\"Your order <b>#87890</b> has been cancelled.\",\"suggestions\":[\"Back to main menu\",\"Need help with something else\"]},{\"text\":\"Order #90910\",\"reply\":\"Your order <b>#90910</b> has been cancelled.\",\"suggestions\":[\"Back to main menu\",\"Need help with something else\"]},{\"text\":\"Cancel an order\",\"reply\":\"Pick the order you need to cancel.\",\"suggestions\":[\"Order #87890\",\"Order #90910\"]},{\"text\":\"Back to main menu\",\"reply\":\"You have returned to the main menu. What would you like to do next?\",\"suggestions\":[\"Track an order\",\"Cancel an order\"]},{\"text\":\"Need help with something else\",\"reply\":\"Please hold while we connect you to a support agent. You can chat with them for any additional queries.\",\"suggestions\":[]}],\"defaultChatSuggestions\":[\"Awesome!\",\"What kind of painting ?\"],\"integrationListTemplateData\":[{\"id\":\"01\",\"title\":\"Albert\",\"imgSrc\":\"andrew\",\"message\":\"Okay, I\\'ll try that. Thanks for the help!\"},{\"id\":\"02\",\"title\":\"Bot\",\"imgSrc\":\"bot\",\"message\":\"Personal decor assistant\"},{\"id\":\"03\",\"title\":\"Charlie\",\"imgSrc\":\"charlie\",\"message\":\"Great! Let\\'s finalize our plans this weekend.\"},{\"id\":\"04\",\"title\":\"Laura\",\"imgSrc\":\"laura\",\"message\":\"10 AM works for me.\"},{\"id\":\"05\",\"title\":\"New Dev Team\",\"imgSrc\":\"calendar\",\"message\":\"User added\"},{\"id\":\"06\",\"title\":\"Reena\",\"imgSrc\":\"reena\",\"message\":\"You: Hi, are you available ?\"}]}');\n\n//# sourceURL=webpack://ej2-interactive-chat-vue-samples/./Samples/chat-ui/chat-integration/messageData.json?");

